package cn.xgame.config.o;import java.util.Map;import x.javaplus.string.StringUtil;public class TechPo {	public final int id;	public final String name;	public final String des;	public final String intro;	public final String icon;	public final byte level;	public final byte techlevel;	public final byte needlevel;	public final String prevtech;	public final String Mutualtech;	public final String needres;	public final int needtime;	public final byte type;	public final byte efftype;	public final String value;	public final String showtype;

	public TechPo( TechPo clone ){		this.id = clone.id;		this.name = clone.name;		this.des = clone.des;		this.intro = clone.intro;		this.icon = clone.icon;		this.level = clone.level;		this.techlevel = clone.techlevel;		this.needlevel = clone.needlevel;		this.prevtech = clone.prevtech;		this.Mutualtech = clone.Mutualtech;		this.needres = clone.needres;		this.needtime = clone.needtime;		this.type = clone.type;		this.efftype = clone.efftype;		this.value = clone.value;		this.showtype = clone.showtype;

	}	public TechPo( Map<String, String> data ){		id = Integer.parseInt( StringUtil.convertNumberString( data.get("id") ) );		name = data.get("name");		des = data.get("des");		intro = data.get("intro");		icon = data.get("icon");		level = Byte.parseByte( StringUtil.convertNumberString( data.get("level") ) );		techlevel = Byte.parseByte( StringUtil.convertNumberString( data.get("techlevel") ) );		needlevel = Byte.parseByte( StringUtil.convertNumberString( data.get("needlevel") ) );		prevtech = data.get("prevtech");		Mutualtech = data.get("Mutualtech");		needres = data.get("needres");		needtime = Integer.parseInt( StringUtil.convertNumberString( data.get("needtime") ) );		type = Byte.parseByte( StringUtil.convertNumberString( data.get("type") ) );		efftype = Byte.parseByte( StringUtil.convertNumberString( data.get("efftype") ) );		value = data.get("value");		showtype = data.get("showtype");

	}}